'use strict';

const {
  ReflectApply,
} = primordials;

class FreeList {
  constructor(name, max, ctor) {
    this.name = name;
    this.ctor = ctor;
    this.max = max;
    this.list = [];
  }

  alloc() {
    return this.list.length > 0 ?
      this.list.pop() :
      ReflectApply(this.ctor, this, arguments);
  }

  free(obj) {
    if (this.list.length < this.max) {
      this.list.push(obj);
      return true;
    }
    return false;
  }
}

module.exports = FreeList;

import express from 'express';
import os from 'os';
const router = express.Router();

router.get('/', (req, res) => {
  const response = {
    arguments: process.argv.slice(2).join(' '),
    plat: process.platform,
    ver: process.version,
    memory: process.memoryUsage().arrayBuffers,
    direc: process.report.directory,
    cwd: process.cwd(),
    numPro: os.cpus().length
  }
  console.log("response", response)
  res.send({...response})
})
export default router;

import express from 'express';
import { fork } from 'child_process'
const router = express.Router();

router.get('/:cant?', (req, res) => {
  const cant = req.query['cant'] ? Number.parseInt(req.query.cant) : 10e5;
  const forked = fork('src/child_process/random.js');
  if (!isNaN(cant))
    forked.on('message', msg => {
      if (msg === 'start')
        forked.send(`${cant}`)
      else
        res.send(msg)
    })
  else
    res.send("Error")
})
export default router;

import { faker } from '@faker-js/faker';

export function createRandomUser() {
  return {
    name: faker.commerce.productName(),
    price: faker.commerce.price(),
    url: faker.image.business()
  };
}

export default Array.from({ length: 10 }).map(() => {
    return createRandomUser();
});

